import React, { Component } from 'react';
class QuoteDetail extends Component {
    constructor(props) {
        super(props);    
    }
    newQuote() {
        this.props.parentCallback();
    }
    editQuote() {

    }
    render() {
        return (
            <div className="app flex-row align-items-center">


                <div className="list-group-header section-header row">
                    <div className="col">
                        <span className="mb-1 underline">Quote </span>
                        <span className="mb-1 blue-color pl-2"> Detail</span>
                    </div>
                    <div className="col text-right">
                        <button type="button" class="btn btn-primary btn-sm pr-4 pl-4" onClick={() => this.newQuote()}>New</button>
                        <button type="button" class="btn btn-primary btn-sm pr-4 pl-4" onClick={() => this.editQuote()}>Edit</button>
                    </div>
                </div>
                <div className="quote-req">


                        <h6>Title</h6>
                        <span>{this.props.dataFromParent.title}</span>


                        <h6>Description</h6>
                        <span>{this.props.dataFromParent.content}</span>

                        <h6>Submitted On</h6>
                        <span>{this.props.dataFromParent.modifiedOn}</span>

                        <h6>Status</h6>
                        <span>{this.props.dataFromParent.status}</span>


                </div>
            </div>
        );
    }
}
export default QuoteDetail;
